"use strict";
// City name: write a function called city_country() that takes in the name of a city
// Call your functiom with at least tree city_country paries.
function city_country(city, country) {
    return `${city},${country}`;
}
console.log(city_country('karachi', 'Pakistan'));
console.log(city_country('tokyo', 'japan'));
console.log(city_country('paries', 'france'));
